    return (
      <div className="text-center">
        <div className="mx-auto h-12 w-12 text-gray-400"> <img src="https://img.icons8.com/external-wanicon-lineal-color-wanicon/64/undefined/external-friend-friendship-wanicon-lineal-color-wanicon.png"/></div>



        <h3 className="mt-2 text-sm font-medium text-gray-900">You have no friend request!</h3>
